<template>
    <div class="roundProfile">
        <svg v-if="this.profile === ''" width="64" height="64" viewBox="0 0 64 64" fill="none"
            xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
            <path fill="url(#a)" d="M0 0h64v64H0z" />
            <defs>
                <pattern id="a" patternContentUnits="objectBoundingBox" width="1" height="1">
                    <use xlink:href="#b" transform="scale(.00093)" />
                </pattern>
                <image id="b" width="1080" height="1080"
                    xlink:href="data:image/png;base64," />
            </defs>
        </svg>
        <img v-else :src="this.profile" :style="this.profileStyle">
    </div>
</template>
<script>
    import { cropImage } from '@/modules/image.js'
    export default {
        name: 'RoundProfile',
        components: {},
        props: {
            profile: {
                type: String,
                default: ''
            }
        },
        data() {
            return {
                profileStyle: ''
            };
        },
        async created() {
            this.profileStyle = await cropImage(this.profile, 1)
        },
    }
</script>
<style lang="scss" scoped src="../scss/widgets/roundProfile.scss">
